import React from 'react';

function ModificarPlanillaMensual() {
  return (
    <div>
      <h2>Modificar Planilla Mensual</h2>
      <p>Aquí irá el formulario para modificar una planilla mensual existente.</p>
    </div>
  );
}

export default ModificarPlanillaMensual;
